import React from "react";
import classes from "./ViewTask.module.scss";
import Modal from "../Modal/Modal";
import { faEllipsisVertical } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const ViewTask = () => {
  return (
    <Modal>
      <section className={classes.view_task}>
        <section className={classes.subtask_heading}>
          <p className={classes.subtask}>
            Research pricing points of various <br />
            competitors and trial different business <br /> models
          </p>
          <FontAwesomeIcon
            icon={faEllipsisVertical}
            className={classes.ellipsisVertical}
          />
        </section>
        <p className={classes.subtask_description}>
          We know what we're planning to build for version one. Now we need to
          finalise the first pricing model we'll use. Keep iterating the
          subtasks until we have a coherent proposition.
        </p>
        <section className={classes.subtasks}>
          <h3 className={classes.subtasks_heading}>Subtasks (2 of 3)</h3>
          <section className={classes.subtasks_todoList}>
            <div className={classes.subtask_item}>
              <input type="checkbox"/>
              <label className={ `${classes} ${classes.strike_through}`}></label>
            </div>
            <div className={classes.subtask_item}>
              <input type="checkbox" />
              <label></label>
            </div>
            <div className={classes.subtask_item}>
              <input type="checkbox" />
              <label></label>
            </div>
          </section>
        </section>
      </section>
    </Modal>
  );
};

export default ViewTask;
